pragma solidity >0.5.0;
pragma experimental ABIEncoderV2;
contract retail {
    
    enum flatStatus{
        forSell,
        underInspection,
        noSell
    }

    struct flat{
        uint id;
        address owner;
        string name;
        string addr;
        uint price;
        string typeOFResidence;
        uint bedRooms;
        uint bathRooms;
        uint squareFeet;
        uint yearBuilt;
        flatStatus status;
        address buyer;
    }

    flat[] public flats;

    function getFlats() public view returns(flat[] memory){
        return flats;
    }

    function buy(uint _id) public{

        flats[_id].buyer = msg.sender;
        flats[_id].status = flatStatus.underInspection;
    }

    function sell(uint _id) public{
        flats[_id].owner = flats[_id].buyer;
        flats[_id].buyer = 0x0000000000000000000000000000000000000000;
        flats[_id].status = flatStatus.noSell;
    }

    function makeForSell(uint _id) public returns(bool){
        if(msg.sender == flats[_id].owner){
            flats[_id].status = flatStatus.forSell;
            return true;
        }
        return false;
    }

    // to destroy deployed contract
    address payable contractOwner;
    function destroy() public{
        selfdestruct(contractOwner);
    }

    constructor() public {

        contractOwner = address(uint160(0xa802beaE0c5C90E96241Fd0000c7c258de131080));

        flats.push(flat(0, 0x95c942cE0BD7a66D6b9515E13fAC1d5da8A5FF5E, "NYC Penthouse", "157 W 57th st APT 498, New York, NY 10010", 20, "condo", 2, 3, 2200, 2013, flatStatus.forSell, 0x0000000000000000000000000000000000000000));

        flats.push(flat(1, 0xB355378d82825aC7cF1ac96E837Fd712cF7721d1, "", "70780 Tamarisk Ln, Rancho Mirage, CA 92270", 15, "", 4, 4, 3979, 2010, flatStatus.forSell, 0x0000000000000000000000000000000000000000));

        flats.push(flat(2, 0x47aFBc529162dbE9FDFAa373A78c65a86E550A50, "Driven Woods", "183 Woodland Drive, Camano Island, WA 98282", 10, "House", 3, 3, 2202, 2016, flatStatus.forSell, 0x0000000000000000000000000000000000000000));
    }
}
